import React from "react";

class Question extends React.Component {
  render() {
    return (
      <div>
        <p>{this.props.question.text}</p>
        <button name="true" onClick={this.props.handleClick}>
          True
        </button>
        <button name="false" onClick={this.props.handleClick}>
          False
        </button>
      </div>
    );
  }
}

export default Question;
